u-dulu lagi fiil Besah begitu. TIdak pernah berubah-ubah sampailah ke tua.  Besah lebih senang bermalam di hotel. Selesa, katanya. Tidak banyak nyamuk macam di rumah Seman. Di hotel tidak ada pijat-pijat,  tidak ada tikus yang merayap. Seman tidak berkata apa-apa. Tapi hati tuanya tersentuh juga. Dia tidak mampu menghalang.  Itu sudah kehendak Besah sendiri. Dia sedar keadaan hidupnya yang serba daif. Gelisah Seman makin menjadi. Seman menarik naik kain pelikat lusuhnya itu yang beransur menggelongsor turun. Deru angin malam terasa begitu mencengkam. Dingin. Menggigil Seman dibuatnya. Tiba-tiba wajah Anisah bertandang lagi di kamar ingatannya. Alangkah bahaginya kalau Anisah ada di sisinya. Ada di sampingnya pada saat-saat begini.  Teringat Seman apabila menjelang waktu tengah malam begini, kalau dia tidak turun ke laut, Anisah akan menyediakan kopi o\' panas. Sedap rasanya kopi o\' yang dibancuh oleh Anisah, mengalahkan kopi o\' Pak Mak yang kedainya terletak di simpang tiga jalan menghala ke kampungnya, Pulau Besar. Tidak cukup secawan, dua tiga cawan pun dapat dihabiskannya.','Tapi/KH hasrat/KN dan/KH keinginan/KN Besah/KNK tidak/KNF boleh/KB ditahan-tahan/KK ./. Tidak/KNF boleh/KB dibantah-bantah/KK !/! Begitulah/NON fiil/KN Besah/KNK ./. Apa/KT yang/KH diinginkan/KK tidak/KNF boleh/KB disekat-sekat/KK ./. Diajak/KK mereka/KGN bermalam/KK di/KSN pondok/KN buruknya/ADJ pun/NON tidak/KNF mahu/KK ,/, Besah/KNK terutamanya/ADV ./.+$ Seman/KNK perasan/KK itu/KGT ./.  Sejak/KSN dulu-dulu/ADV lagi/ADV fiil/KN Besah/KNK begitu/ADV ./. TIdak/KNF pernah/KB berubah-ubah/KK sampailah/NON ke/KSN tua/ADJ ./.  Besah/KNK lebih/KB senang/ADJ bermalam/KK di/KSN hotel/KN ./. Selesa/ADJ ,/, katanya/KK ./.+$ Tidak/KNF banyak/KBIL nyamuk/KN macam/KSN di/KSN rumah/KN Seman/KNK ./. Di/KSN hotel/KN tidak/KNF ada/NON pijat-pijat/KN ,/,  tidak/KNF ada/NON tikus/KN yang/KH merayap/KK ./. Seman/KNK tidak/KNF berkata/KK apa-apa/KGN ./. Tapi/KH hati/KN tuanya/ADJ tersentuh/KK juga/NON ./. Dia