,_, beralun-alun_KA ,_, bergulung-gulung_KI !_! Perlahan_SA Seman_NK bangkit_KI dan_HS mengatup_KT daun_NA pintu_NA yang_HR berlorekkan_KT bunga_NA raya_SA ._. Dengan_IA malas_SA Seman_NK merebahkan_KT badannya_NA+$ di_IL atas_NL tilam_NA yang_HR sudah_PA carik_KT ,_, terjongkol_KS kekabu_NA yang_HR sudah_PA hilang_KT warna_NA keputihannya_NA ._.+$ Seman_NK terlena_KS akhirnya_SA+$ dalam_NL getaran_NA ombak_NA di_IL dada_NA !_! Matahari_NA sudah_PA meninggi_KI hampir_AT segalah_NP ._. Tompokan_NA awan_NA putih_SA berarak_KI gagah_SA di_IL dada_NA awan_NA ._. Tidak_XA ada_KW tanda-tanda_NA hujan_NA akan_PA mencurah_KT ._. Persekitaran_NA kampung_NA Pulau_NA Besar_SA dalam_NL jajahan_NA Tumpat_NK ,_, terang_SA benderang_SA ._. Seman_NK mengucap_KT syukur_NA ,_, lega_SA ._. Ini_DA bermakna_KA dapatlah_KI+E dia_GD ke_IL laut_NA malam_NW nanti_AW ._. Sekurang-kurangnya_AI dia_GD dapat_PM menambahkan_KT rezekinya_NA+$ pada_IA minggu_NW ini_DA ._. Bakul-bakul_NA dan_HS topi-topi_NA yang_HR dianyamkan_KP sepanjang_SS minggu_NW lalu_KI sudah_PA siap_KT semuanya_BK+$ dan_HS dia_GD cuma_AA perlu_PM menunggu_KT orang-orang_NA dari_IL pusat_NA kraftangan_NA datang_KI mengambilnya_KT+$ untuk_IA dibawa_KP dan_HS dipasarkan_KP di_IL bandar_NA Kota_NA Bharu_SA atau_HS sebagainya_NA ._.+$ Sekarang_AW musim_NA Tahun_NW Melawat_KT Malaysia_NK ,_, kata_KT pegawai-pegawai_NA dari_IL pusat_NA kraftangan_NA ._. ','Bukan sahaja cantik, tapi juga pintar. Anisah gadis yang bijak, pelajar yang cerdas dalam pelajaran. Kalau kurang pun, kerana Anisah tempang. Jalan Anisah terhenjot-henjot, malah terpaksa dibantu oleh kayu tupang. Itulah kekurangan Anisah! Seman mengeluh kecil. Malam semakin larut. Wajah bulan pun semakin berengsot dan pudar. Bintang-bintang mengerdip samar. Cuma gelora ombak yang masih keras membadai. Seperti gelora resah di dada Seman, beralun-alun, bergulung-gulung! Perlahan Seman bangkit dan mengatup daun pintu yang berlorekkan bunga raya. Dengan malas Seman merebahkan badannya di atas tilam yang sudah carik, terjongkol kekabu yang sudah hilang warna keputihannya. Seman terlena akhirnya dalam getaran ombak di dada! Matahari sudah meninggi hampir segalah. Tompokan awan putih berarak gagah di dada awan. Tidak ada tanda-tanda hujan akan mencurah. Persekitaran kampung Pulau Besar dalam jajahan Tumpat, terang benderang. Seman mengucap syukur, lega. Ini bermakna dapatlah dia ke laut malam nanti. Sekurang-kurangnya dia dapat menambahkan rezekinya pada minggu ini. Bakul-bakul dan topi-topi yang dianyamkan sepanjang minggu lalu sudah siap semuanya dan dia cuma perlu menunggu orang-orang dari pusat kraftangan datang mengambilnya untuk dibawa dan dipasarkan di bandar Kota Bharu atau sebagainya. Sekarang musim Tahun Melawat Malaysia, kata pegawai-pegawai dari pusat kraftangan. ','Bukan/KNF sahaja/NON cantik/ADJ ,/, tapi/KH juga/NON pintar/ADJ ./. Anisah/KNK gadis/KN yang/KH bijak/ADJ ,/, pelajar/KN yang/KH cerdas/ADJ dalam/KN pelajaran/KN ./. Kalau/KH kurang/KB pun/NON ,/,ngkin_PM kerana/KH Anisah/KNK tempang/ADJ ./. Jalan/KN Anisah/KNK terhenjot-henjot/KK ,/, malah/ADV terpaksa/KK dibantu/KK oleh/KSN kayu/KN tupang/KN ./. Itulah/NON kekurangan/KN Anisah/KNK !/! Seman/KNK mengeluh/KK kecil/ADJ ./. Malam/KN semakin/ADV larut/KK ./. Wajah/KN bulan/KN pun/NON semakin/ADV berengsot/KK dan/KH pudar/ADJ ./. Bintang-bintang/KN mengerdip/KK samar/ADJ ./. Cuma/ADV gelora/KN ombak/KN yang/KH masih/KB keras/ADJ membadai/KK ./. Seperti/KSN gelora/KN resah/ADJ di/KSN dada/KN Seman/KNK ,/, beralun-alun/KK ,/, bergulung-gulung/KK !/! Perlahan/ADJ Seman/KNK bangkit/KK dan/KH mengatup/KK daun/KN pintu/KN yang/KH berlorekkan/KK bunga/KN raya/ADJ ./. Dengan/KSN malas/ADJ Seman/KNK merebahkan/KK badannya/KN di/KSN atas/KN tilam/KN yang/KH sudah/KB carik/KK ,/, terjongkol/KK kekabu/KN yang/KH sudah/KB hilang/KK warna/KN keputihannya/KN ./.+$ Seman/KNK terlena/KK akhirnya/ADJ dalam/KN getaran/KN ombak/KN di/KSN dada/KN !/! Matahari/KN sudah/KB meninggi/KK hampir/ADV seg