/*Table structure for table `korpus_lexicon_originals` */

DROP TABLE IF EXISTS `korpus_lexicon_originals`;

CREATE TABLE `korpus_lexicon_originals` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `lexicon_id` int(11) unsigned NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `tag` varchar(255) DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `modified` datetime DEFAULT NULL,
  PRIMARY KEY (`id`,`lexicon_id`),
  KEY `fk_korpus_lexicon_originals_korpus_lexicons1_idx` (`lexicon_id`),
  CONSTRAINT `fk_korpus_lexicon_originals_korpus_lexicons1` FOREIGN KEY (`lexicon_id`) REFERENCES `korpus_lexicons` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=69 DEFAULT CHARSET=latin1;

