insert  into `korpus_paragraphs`(`id`,`input_id`,`value`,`created`,`modified`) values (6,5,'Bukan_XN sahaja_LA cantik_SA ,_, tapi_HS juga_LA pintar_SA ._. Anisah_NK gadis_NA yang_HR bijak_SA ,_, pelajar_NA yang_HR cerdas_SA dalam_NL pelajaran_NA ._. Kalau_HB kurang_PI pun_LAmu ,_,ngkin_PM kerana_HB Anisah_NK tempang_SA ._. Jalan_NA Anisah_NK terhenjot-henjot_KS ,_, malah_AA terpaksa_KS dibantu_KP oleh_IA kayu_NA tupang_NA ._. Itulah_DA+E kekurangan_NA Anisah_NK !_! Seman_NK mengeluh_KI kecil_SA ._. Malam_NW semakin_AI larut_KT ._. Wajah_NA bulan_NA pun_LA semakin_AI berengsot_KI dan_HS pudar_SA ._. Bintang-bintang_NA mengerdip_KT samar_SA ._. Cuma_AA gelora_NA ombak_NA yang_HR masih_PA keras_SA membadai_KI ._. Seperti_IA gelora_NA resah_SA di_IL dada_NA Seman_NK ,_, beralun-alun_KA ,_, bergulung-gulung_KI !_! Perlahan_SA Seman_NK bangkit_KI dan_HS mengatup_KT daun_NA pintu_NA yang_HR berlorekkan_KT bunga_NA raya_SA ._. Dengan_IA malas_SA Seman_NK merebahkan_KT badannya_NA+$ di_IL atas_NL tilam_NA yang_HR sudah_PA carik_KT ,_, terjongkol_KS kekabu_NA yang_HR sudah_PA hilang_KT warna_NA keputihannya_NA ._.+$ Seman_NK terlena_KS akhirnya_SA+$ dalam_NL getaran_NA ombak_NA di_IL dada_NA !_! Matahari_NA sudah_PA meninggi_KI hampir_AT segalah_NP ._. Tompokan_NA awan_NA putih_SA berarak_KI gagah_SA di_IL dada_NA awan_NA ._. Tidak_XA ada_KW tanda-tanda_NA hujan_NA akan_PA mencurah_KT ._. Persekitaran_NA kampung_NA Pulau_NA Besar_SA dalam_NL jajahan_NA Tumpat_NK ,_, terang_SA benderang_SA ._. Seman_NK mengucap_KT syukur_NA ,_, lega_SA ._. Ini_DA bermakna_KA dapatlah_KI+E dia_GD ke_IL laut_NA malam_NW nanti_AW ._. Sekurang-kurangnya_AI dia_GD dapat_PM menambahkan_KT rezekinya_NA+$ pada_IA minggu_NW ini_DA ._. Bakul-bakul_NA dan_HS topi-topi_NA yang_HR dianyamkan_KP sepanjang_SS minggu_NW lalu_KI sudah_PA siap_KT semuanya_BK+$ dan_HS dia_GD cuma_AA perlu_PM menunggu_KT orang-orang_NA dari_IL pusat_NA kraftangan_NA datang_KI mengambilnya_KT+$ untuk_IA dibawa_KP dan_HS dipasarkan_KP di_IL bandar_NA Kota_NA Bharu_SA atau_HS sebagainya_NA ._.+$ Sekarang_AW musim_NA Tahun_NW Melawat_KT Malaysia_NK ,_, kata_KT pegawai-pegawai_NA dari_IL pusat_NA kraftangan_NA ._. ','2015-02-17 14:54:13','2015-02-17 14:54:13'),(7,1,'Besah_NK lebih_PI mementingkan_KT diri_NA sendiri_GK ._. Sama_SA juga_LA seperti_IA Jusoh_NK ,_, suami_NA Besah_NK ._. Masing-masing_BK keras_SA kepala_NA ._. Langsung_AA tidak_XA mahu_KK berunding_KI secara_NA damai_SA ._. Tidak_XA mahu_KK berunding_KI ,_,  berkira_KI bicara_NA secara_NA adik_NA beradik_KA ._. Cuma_AA bezanya_NA ,_,+$ Jusoh_NK agak_PI pendiam_SA ._. Tidak_XA becok_SA seperti_IA mulut_NA Besah_NK yang_HR cakapnya_NA+$ sering_AF tidak_XA berlapik_KI ._. Macam_IA murai_NA yang_HR dicabut_KP ekornya_NA ,_,+$ dua_#K puluh_#K empat_#K jam_NW berdecit_KA bising_SA ._. Tapi_HS Jusoh_NK masih_PA boleh_PM diajak_KP kira_NA bicara_NA ._.  Masih_PA boleh_PM dibawa_KP berunding_KI ._. Tapi_HS masih_PA juga_LA mengikut_KT telunjuk_NA isteri_NA ._. Masih_PA dikontrol_KP oleh_IA Besah_NK ._. Langsung_AA Jusoh_NK tidak_XA berani_SA membantah_KT ._. Tidak_XA tahu_KC memprotes_KI ._.  \" Kami_GD datang_KI ni_DA ada_KW hajat_NA ,_, Abang_NA Long,\"_NK Besah_NK memulakan_KT bicara_NA sebaik_SS saja_LA bersimpuh_KI di_IL ruang_NA tamu_NA yang_HR tidak_XA seluas_SS mana_TL ._. Seman_NK pada_IA mulanya_NA+$ terlalu_PI gembira_SA menyambut_KT kedatangan_NA Besah_NK dan_HS Jusoh_NK ._. Maklumlah_KX+E mereka_GD sudah_PA terlalu_PI lama_SA tidak_XA bertemu_KI ._. Bukan_XN senang_SA untuk_IA selalu_AF bersama_IA begini_AC ._. Malah_AA ,_, seingat-ingat_AA Seman_NK ,_, inilah_DA+E pertama_#O kali_NA mereka_GD bertemu_KI selepas_HB kematian_NA Munah_NK ,_, isterinya_NA+$ yang_HR juga_LA kakak_NA kepada_IL Besah_NK ._. Setelah_HB tujuh_#K tahun_NW lebih_PI kurang_PI isterinya_NA+$ meninggal_KI barulah_SA+E kali_NA ini_DA mereka_GD berjumpa_KT semula_AA ._. Semasa_HB kematian_NA Munah_NK dulu_AW ,_, Besah_NK dan_HS Jusoh_NK tidak_XA di_IL Singapura_NK ._. Mereka_GD pergi_KI makan_KT angin_NA ke_IL Jepun_NK ._. Walaupun_HB telegram_NA dikirim_KP ke_IL rumah_NA mereka_GD di_IL Singapura_NK ,_, namun_HB tidak_XA ada_KW sebarang_BK tindakan_NA susulan_NA daripada_IA anak_NA buah_NP mereka_GD di_IL sana_GL ._.','2015-02-17 15:06:31','2015-02-17 15:06:31'),(8,2,'Tapi_HS hasrat_NA dan_HS keinginan_NA Besah_NK tidak_XA boleh_PM ditahan-tahan_KP ._. Tidak_XA boleh_PM dibantah-bantah_KP !_! Begitulah_DA+E fiil_NA Besah_NK ._. Apa_TN yang_HR diinginkan_KP tidak_XA boleh_PM disekat-sekat_KP ._. Diajak_KP mereka_GD bermalam_KI di_IL pondok_NA buruknya_SA+$ pun_LA tidak_XA mahu_KK ,_, Besah_NK terutamanya_AA ._.+$ Seman_NK perasan_KC itu_DA ._.  Sejak_IA dulu-dulu_AW lagi_AA fiil_NA Besah_NK begitu_AC ._. TIdak_XA pernah_PA berubah-ubah_KI sampailah_HB+E ke_IL tua_SA ._.  Besah_NK lebih_PI senang_SA bermalam_KI di_IL hotel_NA ._. Selesa_SA ,_, katanya_KT ._.+$ Tidak_XA banyak_BK nyamuk_NA macam_IA di_IL rumah_NA Seman_NK ._. Di_IL hotel_NA tidak_XA ada_KW pijat-pijat_NA ,_,  tidak_XA ada_KW tikus_NA yang_HR merayap_KI ._. Seman_NK tidak_XA berkata_KC apa-apa_GI ._. Tapi_HS hati_NA tuanya_SA+$ tersentuh_KT juga_LA ._. Dia_GD tidak_XA mampu_KK menghalang_KT ._.  Itu_Da sudah_PA kehendak_NA Besah_NK sendiri_GK ._. Dia_GD sedar_KC keadaan_NA hidupnya_KI+$ yang_HR serba_BK daif_SA ._. Gelisah_SA Seman_NK makin_PI menjadi_KH ._. Seman_NK menarik_KT naik_KT kain_NA pelikat_NA lusuhnya_SA+$ itu_DA yang_HR beransur_AC menggelongsor_KI turun_KI ._. Deru_NA angin_NA malam_NW terasa_KH begitu_AC mencengkam_KT ._. Dingin_SA ._. Menggigil_KI Seman_NK dibuatnya_KP ._.+$ Tiba-tiba_AC wajah_NA Anisah_NK bertandang_KA lagi_AA di_IL kamar_NA ingatannya_NA ._.+$ Alangkah_ZS bahaginya_SA+$ kalau_HB Anisah_NK ada_KW di_IL sisinya_IL ._.+$ Ada_KW di_IL sampingnya_NA+$ pada_IA saat-saat_NA begini_AC ._.  Teringat_KS Seman_NK apabila_HB menjelang_KT waktu_NA tengah_NL malam_NW begini_AC ,_, kalau_HB dia_GD tidak_XA turun_KI ke_IL laut_NA ,_, Anisah_NK akan_PA menyediakan_KT kopi_NA o\'_NA panas_SA ._. Sedap_SA rasanya_KI+$ kopi_NA o\'_NA yang_HR dibancuh_KP oleh_IA Anisah_NK ,_, mengalahkan_KT kopi_NA o\'_NA Pak_NG Mak_NK yang_HR kedainya_NA+$ terletak_KS di_IL simpang_NA tiga_#K jalan_NA menghala_KT ke_IL kampungnya_NA ,_,+$ Pulau_NA Besar_SA ._. Tidak_XA cukup_PI secawan_NS ,_, dua_#K tiga_#K cawan_NA pun_LA dapat_PM dihabiskannya_KP ._.+$','2015-02-17 15:19:10','2015-02-17 15:19:10'),(18,6,'Besah/KNK lebih/KB mementingkan/KK diri/KN sendiri/KGN ./. Sama/ADJ juga/NON seperti/KSN Jusoh/KNK ,/, suami/KN Besah/KNK ./. Masing-masing/KBIL keras/ADJ kepala/KN ./. Langsung/ADV tidak/KNF mahu/KK berunding/KK secara/KN damai/ADJ ./. Tidak/KNF mahu/KK berunding/KK ,/, berkira/KK bicara/KN secara/KN adik/KN beradik/KK ./. Cuma/ADV bezanya/KN ,/,+$ Jusoh/KNK agak/KB pendiam/ADJ ./. Tidak/KNF becok/ADJ seperti/KSN mulut/KN Besah/KNK yang/KH cakapnya/KN sering/ADV tidak/KNF berlapik/KK ./. Macam/KSN murai/KN yang/KH dicabut/KK ekornya/KN ,/,+$ dua/KBIL puluh/KBIL empat/KBIL jam/KN berdecit/KK bising/ADJ ./. Tapi/KH Jusoh/KNK masih/KB boleh/KB diajak/KK kira/KN bicara/KN ./. Masih/KB boleh/KB dibawa/KK berunding/KK ./. Tapi/KH masih/KB juga/NON mengikut/KK telunjuk/KN isteri/KN ./. Masih/KB dikontrol/KK oleh/KSN Besah/KNK ./. Langsung/ADV Jusoh/KNK tidak/KNF berani/ADJ membantah/KK ./. Tidak/KNF tahu/KK memprotes/KK ./. \"/NON Kami/KGN datang/KK ni/KGT ada/NON hajat/KN ,/, Abang/KN Long,\"/NON_NK Besah/KNK memulakan/KK bicara/KN sebaik/ADJ saja/NON bersimpuh/KK di/KSN ruang/KN tamu/KN yang/KH tidak/KNF seluas/ADJ mana/KT ./. Seman/KNK pada/KSN mulanya/KN terlalu/KB gembira/ADJ menyambut/KK kedatangan/KN Besah/KNK dan/KH Jusoh/KNK ./. Maklumlah/NON mereka/KGN sudah/KB terlalu/KB lama/ADJ tidak/KNF bertemu/KK ./. Bukan/KNF senang/ADJ untuk/KSN selalu/ADV bersama/KSN begini/ADV ./. Malah/ADV ,/, seingat-ingat/ADV Seman/KNK ,/, inilah/NON pertama/KBIL kali/KN mereka/KGN bertemu/KK selepas/KH kematian/KN Munah/KNK ,/, isterinya/KN yang/KH juga/NON kakak/KN kepada/KSN Besah/KNK ./. Setelah/KH tujuh/KBIL tahun/KN lebih/KB kurang/KB isterinya/KN meninggal/KK barulah/NON kali/KN ini/KGT mereka/KGN berjumpa/KK semula/ADV ./. Semasa/KH kematian/KN Munah/KNK dulu/ADV ,/, Besah/KNK dan/KH Jusoh/KNK tidak/KNF di/KSN Singapura/KNK ./. Mereka/KGN pergi/KK makan/KK angin/KN ke/KSN Jepun/KNK ./. Walaupun/KH telegram/KN dikirim/KK ke/KSN rumah/KN mereka/KGN di/KSN Singapura/KNK ,/, namun/KH tidak/KNF ada/NON sebarang/KBIL tindakan/KN susulan/KN daripada/KSN anak/KN buah/KN mereka/KGN di/KSN sana/KGN ./.','2015-02-17 16:41:55','2015-02-17 16:41:55'),(19,7,'Besah lebih mementingkan diri sendiri. Sama juga seperti Jusoh, suami Besah. Masing-masing keras kepala. Langsung tidak mahu berunding secara damai. Tidak mahu berunding, berkira bicara secara adik beradik. Cuma bezanya, Jusoh agak pendiam. Tidak becok seperti mulut Besah yang cakapnya sering tidak berlapik. Macam murai yang dicabut ekornya, dua puluh empat jam berdecit bising. Tapi Jusoh masih boleh diajak kira bicara. Masih boleh dibawa berunding. Tapi masih juga mengikut telunjuk isteri. Masih dikontrol oleh Besah. Langsung Jusoh tidak berani membantah. Tidak tahu memprotes. \" Kami datang ni ada hajat, Abang Long,\" Besah memulakan bicara sebaik saja bersimpuh di ruang tamu yang tidak seluas mana. Seman pada mulanya terlalu gembira menyambut kedatangan Besah dan Jusoh. Maklumlah mereka sudah terlalu lama tidak bertemu. Bukan senang untuk selalu bersama begini. Malah, seingat-ingat Seman, inilah pertama kali mereka bertemu selepas kematian Munah, isterinya yang juga kakak kepada Besah. Setelah tujuh tahun lebih kurang isterinya meninggal barulah kali ini mereka berjumpa semula. Semasa kematian Munah dulu, Besah dan Jusoh tidak di Singapura. Mereka pergi makan angin ke Jepun. Walaupun telegram dikirim ke rumah mereka di Singapura, namun tidak ada sebarang tindakan susulan daripada anak buah mereka di sana.','2015-02-17 16:45:57','2015-02-17 16:45:57');

